import React from "react";
import { NavLink, } from "react-router-dom";
import logo from "../asset/Dhaval file/logo.jpeg";
import {IoMenu} from "react-icons/io5"

const Navbar = () => {

  function humMenu() {

    console.log("working function ")

  }



  return (
    <div className=" relative">
      <nav className="flex justify-between w-[88%] mx-auto mt-8 items-center  visible ">
        <NavLink to="/">
          <div>
            <img src={logo} alt="logo" width={90} height={60}></img>
          </div>
        </NavLink>

        <div><IoMenu onClick={humMenu()} className="bg-[#46BBCD] text-white rounded-md text-4xl px-1  visible md:invisible "/></div>

  

        <div className="flex gap-x-12   bg-[#46BBCD] text-white text-center justify-center items-center py-3 px-16 rounded-lg  invisible sm:visible">
          <NavLink to="/">
            <div className=" font-medium text-lg  hover-underline-animation">Home</div>
          </NavLink>

          <NavLink to="/products">
            <button className=" font-medium  text-lg hover-underline-animation">
            Product</button>
          </NavLink>

          <NavLink to="/">
            <div className=" font-medium text-lg hover-underline-animation">
            About Us</div>
          </NavLink>

          <NavLink to="/">
            <div className="font-semibold text-lg hover-underline-animation  ">Contact Us</div>
          </NavLink>
        </div>
      </nav>
    </div>
    
  );
};

export default Navbar;
